【あす楽対応_九州】【あす楽対応_関東】<BR>【あす楽対応_東海】【あす楽対応_近畿】<BR>【あす楽対応_関西】<BR><BR><font size="2">
液体はもちろん詰め替え用ボトルがそのまま入る2WAYタイプのシンプルなキッチンディスペンサーです。SサイズとLサイズの2種類あります。Sサイズは小さい詰め替え袋がそのまま入ります。Lサイズは2回分詰め替え用ボトルがしっかり入ります。<BR><BR>
■サイズ：幅6.7×奥行き8.5×高さ26.5cm<BR>
■容量：約700ml<BR>
■素材<BR>
本体・カバー・ポンプ/ABS樹脂<BR>
パイプ/ポリエチレン<BR>
台座/エラストマー</font><BR><BR>
