color:#c00;
padding:5px 0 0 10px;
font-weight:bold;
margin-top:15px;
}

/*背景ボタン用ここまで*/

-->

input[value="買い物かごに入れる"]{
background:url("http://image.rakuten.co.jp/monogallery/cabinet/kago/okaimonokagoniireru.jpg");
width:270px;
height:60px;
text-indent:-9999px;
border:none;
cursor:pointer;
margin-top:8px;
}

input[value="買い物かごに入れる"]:hover{
opacity:0.8;
}

/* 個数入力欄の大きさ */
input#units {
padding: 10px 5px;
}


select{
font-size:16px;
color:#000000;
font-weight:bold;
width:360px;
display:block;
padding:4px;
margin:0 0 0px;
}





<!--

